import React from 'react'
import BackgroundAbout from '../images/background-about.jpg'
import '../styles/About.css'

function About() {
  return (
    <div className="about">
        <div className="about">
         <h1>ABOUT US</h1>
        <p><p>Lorem ipsum dolor sit amet. At quasi reprehenderit non esse odio eos nulla reprehenderit et ipsum error. Id dolores galisum et doloribus laudantium qui galisum numquam non consequatur quas. </p><p>Sed aspernatur numquam in accusantium eaque qui dignissimos nihil nam animi sunt At possimus sint. Ab dignissimos praesentium ut aperiam doloremque et galisum neque. Sed officiis pariatur sit quis architecto eos enim consequatur aut iure aperiam nam sapiente nostrum vel temporibus nesciunt ut commodi repellat. Id dolores quam in libero dolor et nostrum explicabo ab magni sequi et quaerat voluptatem. </p><p>Aut earum officiis aut repellendus totam nam magnam enim 33 modi totam ea omnis reiciendis 33 iste numquam. Hic perspiciatis ipsam et doloremque fuga qui voluptatem quibusdam At voluptatum nesciunt ut quia minima. </p></p>
        style={{ backgroundImage: `url(${BackgroundAbout})` }}
        </div>
    </div>
  )
}
export default About
